package db.domain;import java.util.Arrays;public class EquipmentHadImpl implements EquipmentHad {	@Key	private String uname;	@Key	private int equipmentTypeId;	public EquipmentHadImpl() {	}	public EquipmentHadImpl(EquipmentHad c) {		this.uname = c.getUname();		this.equipmentTypeId = c.getEquipmentTypeId();	}	@Override	public String tableName() {		return "equipment_had";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setEquipmentTypeId(int equipmentTypeId) {		this.equipmentTypeId = equipmentTypeId;	}	public int getEquipmentTypeId() {		return this.equipmentTypeId;	}public void addEquipmentTypeId(int equipmentTypeId) {		this.equipmentTypeId += equipmentTypeId;}}